// import { Card } from "react-bootstrap";

import { useEffect } from "react";
import { Col, Container, Row, Table } from "react-bootstrap";
import { useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import Img from "../../layout/img";
import Quantity from "../../layout/quantity";
import { GetAuthDetail } from "../../layout/utils";
import Mybreadcrumb from "../breadcrumb";

export default function Card(prop){
    const navigate = useNavigate();
    const userAthantication = GetAuthDetail();
    const cardData = useSelector(card => card.CartReducer.cardData);
    useEffect(()=>{
        if(!userAthantication){
            navigate("/login")
        }
    })
    return(
        <>
            <div className='page-wrapper'>
                <Mybreadcrumb />
                <div className="cardMain">
                    <Container>
                        <div className="heading d-flex align-items-center justify-content-between">
                            <h1>Shopping Card</h1>
                            <p>Need Help? Call 00800 287 866 13</p>
                        </div>
                        <Row>
                            <Col lg={8}>
                                <Table striped bordered hover>
                                    <thead>
                                        <tr>
                                            <th>Products Details</th>
                                            <th>Quantity</th>
                                            <th>Total Price</th>
                                            <th>Remove</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {
                                            console.log(cardData)}
                                        {
                                            cardData.map(data=>{
                                                return(
                                                    <tr>
                                                        <td>
                                                            <div className="products">
                                                                <Img src={data.images} alt={"img"}/>
                                                                <div className="products_details">
                                                                    <h5>wtf</h5>
                                                                    <p>Color:- Black</p>
                                                                    <p>Size:- M</p>
                                                                    <p>$ 800</p>
                                                                    <p className={"stock"}>In Stock</p>
                                                                </div>
                                                            </div>
                                                        </td>
                                                        <td>
                                                            <Quantity value={1}/>
                                                        </td>
                                                        <td>1x800=$ 800</td>
                                                        <td><a href={"remove"}>x</a></td>
                                                    </tr>
                                                );
                                            })
                                        }
                                    </tbody>
                                </Table>
                            </Col>
                            <Col lg={4}></Col>
                        </Row>
                    </Container>
                </div>
            </div>
        </>
    )
}
